import Link from 'next/link';
import Header from '../comps/Header';
import Layout from '../comps/MyLayout';

export default function Index() {
    return (
        <div>
            <Header />
            <Link href="/about" title="About Page">
                <a>About Page</a>
            </Link>
            <Layout>
                <p>Hello Next.js</p>
            </Layout>
        </div>
    );
}
